import React from 'react'
import { Switch, Route, NavLink } from "react-router-dom";
import "./style.css";
import { Details,SharesDetailWrapper,ValueTitle,Value } from './style';

const Profile = (props) => (<div>
  <a href="#">Gift ID: {props.a.valueSeq().toArray()}</a>
  <p></p>
  <SharesDetailWrapper>
    <Details><ValueTitle>Entered Date</ValueTitle><Value></Value></Details>
    <Details><ValueTitle>Received Date</ValueTitle><Value></Value></Details>
    <Details><ValueTitle>Number of Shares</ValueTitle><Value></Value></Details>
    <Details><ValueTitle>Type</ValueTitle><Value></Value></Details>
    <Details><ValueTitle>Amount</ValueTitle><Value></Value></Details>
    <Details><ValueTitle>Status</ValueTitle><Value></Value></Details>
  </SharesDetailWrapper>
</div>)
const Comments = () => <div>You're on the Comments Tab</div>;
const Contact = () => <div>You're on the Contact Tab</div>;


export function Contributions(props) {
    const { path } = props.match;
    return (
        <React.Fragment>
          <div className="links">
            <NavLink to={`${path}/profile`} ActiveClassName="active" className="link" >profile</NavLink>
            <NavLink to={`${path}/comments`} ActiveClassName="active" className="link">Comments</NavLink>
            <NavLink to={`${path}/contact`} ActiveClassName="active" className="link">Contact</NavLink>
          </div>
        <div className="tabs">
          <Switch>
            <Route exact path={`${path}/profile`} component={Profile} />
            <Route exact path={`${path}/comments`} component={Comments} />
            <Route exact path={`${path}/contact`} component={Contact} />
          </Switch>
        </div>
        </React.Fragment>
    )
}


const mapStateToProps = state => ({
  a:state.getIn(['Dashboard'])
});

export default connect(
  mapStateToProps
)(Contributions);
